export class ClipboardService {
  constructor(private alertService: AlertService) {}

  public copy(value: string, snackMessage = '', snackDuration = 50000) {
    const selBox = document.createElement('textarea');
    selBox.value = value;

    selBox.style.position = 'fixed';
    selBox.style.left = '0';
    selBox.style.top = '0';
    selBox.style.opacity = '0';

    document.body.appendChild(selBox);
    selBox.focus();
    selBox.select();
    document.execCommand('copy');
    document.body.removeChild(selBox);

    if (snackMessage)
      this.alertService.snackBar.open(snackMessage, 'close', {
        duration: snackDuration,
      });
  }
}

import { Injectable } from '@angular/core';
import { FormBuilder } from '@angular/forms';
import { IFormOption } from '../../interfaces/app-form.interface';
import { IFormGeneratorField } from './app-form-generator.interface';

@Injectable({ providedIn: 'root' })
export class FormGeneratorService {
  constructor(private formBuilder: FormBuilder) {}

  public init<Data extends {}>(fields: IFormGeneratorField<keyof Data>[][]) {
    type FieldKeyType = keyof Data;

    return {
      fields,
      group: this.initGroup<Data>(fields),
      setOptionsField: (fieldName: FieldKeyType, options: IFormOption[]) =>
        this.setOptionsField<Data, FieldKeyType>(fields, fieldName, options),
    };
  }

  private initGroup<Data extends {}>(
    fields: IFormGeneratorField<keyof Data>[][]
  ) {
    const group = fields.flat().reduce((initial, field) => {
      const validators = field.validators || [];
      return { ...initial, [field.name]: [field.initialValue, ...validators] };
    }, {});

    return this.formBuilder.group<Data>(group as Data);
  }

  private looperHandler<Data, KeyType>(
    fields: IFormGeneratorField<keyof Data>[][],
    fieldName: KeyType,
    callback: (field: IFormGeneratorField<keyof Data>) => void
  ) {
    fields.forEach((row) =>
      row.forEach((field) => {
        if (field.name === fieldName) callback(field);
      })
    );
  }

  private setOptionsField<Data, FieldKeyType>(
    fields: IFormGeneratorField<keyof Data>[][],
    fieldName: FieldKeyType,
    options: IFormOption[]
  ) {
    this.looperHandler<Data, FieldKeyType>(fields, fieldName, (field) => {
      field.additional = { ...field.additional, options };
    });
  }
}

import { Injectable } from '@angular/core';
import { Title } from '@angular/platform-browser';
import { ActivatedRoute, NavigationEnd, Router } from '@angular/router';
import { Subscription, filter, map } from 'rxjs';

@Injectable({ providedIn: 'root' })
export class SEOService {
  private $routerTitle!: Subscription;

  constructor(
    private title: Title,
    private router: Router,
    private route: ActivatedRoute
  ) {}

  public initTitleMonitoring() {
    this.$routerTitle = this.router.events
      .pipe(
        filter((event) => event instanceof NavigationEnd),
        map(() => {
          const child: ActivatedRoute | null = this.route.firstChild;
          const title = child && child.snapshot.data['title'];

          if (title) return title;
        })
      )
      .subscribe((title) => {
        if (title) this.title.setTitle(`Boilerplate - ${title}`);
      });
  }

  public destoryTitleMonitoring() {
    this.$routerTitle.unsubscribe();
  }
}

import { Injectable } from '@angular/core';
import { THEME_CONFIG } from '../config/theme.config';
import { STORAGE_THEME_STATE_KEY } from '../constants/storage.constant';
import { ThemeType } from '../types/theme.type';

@Injectable({ providedIn: 'root' })
export class ThemeService {
  private readonly defaultTheme: ThemeType = 'light';

  constructor() {}

  public get currentTheme() {
    return (
      (localStorage.getItem(STORAGE_THEME_STATE_KEY) as ThemeType) ||
      this.defaultTheme
    );
  }

  public setTheme(theme: ThemeType) {
    this.setVariables(theme);

    document.body.className = theme;
    localStorage.setItem(STORAGE_THEME_STATE_KEY, theme);
  }

  public init() {
    this.setTheme(this.currentTheme);
  }

  public setVariables(theme: ThemeType) {
    const appStyle = document.documentElement.style;
    if (!appStyle) return;

    const variables = THEME_CONFIG[theme];
    appStyle.setProperty(`--bg-primary`, variables.bgPrimary);
    appStyle.setProperty(`--bg-secondary`, variables.bgSecondary);
    appStyle.setProperty(`--text-primary`, variables.textPrimary);
  }
}

